import React from 'react';


const LastPlayDetail = (data) => {
    const instance = data.props;
    console.log('last play');
    console.log(instance);
    return (
        <div className="tab-content">
            <h1>Last Play</h1>
            <ul>
                <li><p>{instance.clock}</p></li>
                <li><p>{instance.description}</p></li>
            </ul>
            <h5>Don't miss a thing and subscribe to our channel today!</h5>
            <iframe width="560" height="315" src="https://www.youtube.com/embed/FQpFDa5Skzg" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default LastPlayDetail;
